import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-event-list',
  templateUrl: './event-list.page.html',
  styleUrls: ['./event-list.page.scss'],
})
export class EventListPage implements OnInit {

  constructor() { }

  ngOnInit() {
  }

  cards: any[] = [
    {
      title: 'Card 1',
      description: 'This is the description for Card 1.',
      image: 'https://shoalhavenentertainment.com.au/Sites/SEC/Images/Tiles/sec-image_plan-event_functions-events.jpg?ver=2019-10-18-101601-240'
    },
    {
      title: 'Card 2',
      description: 'This is the description for Card 2.',
      image: 'https://shoalhavenentertainment.com.au/Sites/SEC/Images/Tiles/sec-image_plan-event_functions-events.jpg?ver=2019-10-18-101601-240'
    },
    {
      title: 'Card 3',
      description: 'This is the description for Card 3.',
      image: 'https://shoalhavenentertainment.com.au/Sites/SEC/Images/Tiles/sec-image_plan-event_functions-events.jpg?ver=2019-10-18-101601-240'
    },
  ];

}
<ion-header [translucent]="true">
  <ion-toolbar>
    <ion-title>EventList</ion-title>
  </ion-toolbar>
</ion-header>

<ion-content [fullscreen]="true">
  <ion-header collapse="condense">
    <ion-toolbar>
      <ion-title size="large">EventList</ion-title>
    </ion-toolbar>
  </ion-header>
</ion-content>

<ion-content>
  <ion-card *ngFor="let card of cards">
    <img alt="Card Image" src= "{{ card.image }}" />
    <ion-card-header>
      <ion-card-title>
        {{ card.title }}
      </ion-card-title>
    </ion-card-header>

    <ion-card-content>
      {{ card.description }}
    </ion-card-content>
  </ion-card>
</ion-content>
